INSERT INTO `product` VALUES (1,'Bao gồm các loại thịt như thịt bò, thịt gà, thịt lợn, và thịt cá. Thịt tươi thường có hương vị ngon và chất lượng tốt.','Thịt tươi',50000,50000,1),(2,'Bao gồm các loại rau xanh như cải xanh, cà chua, cà rốt, và bắp cải. Rau củ là nguồn cung cấp vitamin và khoáng chất quan trọng cho sức khỏe.','Rau củ',50000,50000,2),(3,'Đây là những món quà thú vị, bao gồm trái cây tươi ngon như táo, cam, và dứa, cùng với hạt như hạt hướng dương và hạt điều.','Quà tặng trái cây và hạt',50000,50000,3),(4,'Bao gồm các loại quả như dâu, mâm xôi, và việt quất. Quả mọng thường giàu chất chống oxy hóa và vitamin C.','Quả mọng tươi',50000,50000,4),(5,'Đây là các loại hải sản như cá hồi, tôm, và sò điệp. Thực phẩm đại dương giàu axit béo omega-3 và protein.','Thực phẩm đại dương',50000,50000,5),(6,'Bơ là nguồn chất béo tốt cho tim mạch, còn trứng chứa nhiều protein và vitamin.','Bơ và trứng',50000,50000,6),(7,'Bao gồm các món ăn nhanh như bánh mì sandwich, pizza, và hamburger. Tuy nhiên, hãy tiêu thụ chúng một cách cân đối để tránh tác động tiêu cực đến sức khỏe.','Thức ăn nhanh',50000,50000,7),(8,'Hành là một loại gia vị phổ biến trong nấu ăn. Nó có thể được sử dụng để gia vị cho các món ăn hoặc làm nền cho nhiều loại nước sốt.','Hành tươi',50000,50000,8),(9,'Đu đủ là một loại quả có vị ngọt và giàu vitamin C. Khoai tây chiên là món ăn phổ biến được làm từ khoai tây cắt lát và chiên giòn.','Đu đủ và khoai tây chiên',50000,50000,9),(10,'Yến mạch là một loại ngũ cốc giàu chất xơ và có lợi cho tiêu hóa.','Yến mạch',50000,50000,10),(11,'Chuối là một loại trái cây giàu kali và vitamin B6. Nó là một lựa chọn tốt cho bữa ăn sáng hoặc bữa ăn nhẹ.','Chuối tươi',50000,50000,11);
/*!40000 ALTER TABLE `product` ENABLE KEYS */;
UNLOCK TABLES;

